import QuenMatKhau from "./Components/quenmatkhau";

function App() {
  return (
    <Router>
       <Switch>
        <Route path="/Dangky" component={DangKy} />
        <Route path="/DangNhap" component={Dangnhap} /> {/* Đường dẫn đến form đăng nhập */}
      </Switch>
    </Router>
  );
}

export default App;
